rasive      negative \n","15   abrupt        negative \n","16   abruptly      negative \n","17   abscond       negative \n","18   absence       negative \n","19   absent-minded negative \n","20   absentee      negative \n","21   absurd        negative \n","22   absurdity     negative \n","23   absurdly      negative \n","24   absurdness    negative \n","25   abundance     positive \n","26   abundant      positive \n","27   abuse         negative \n","28   abused        negative \n","29   abuses        negative \n","30   abusive       negative \n","⋮    ⋮             ⋮        \n","6757 wrestle       negative \n","6758 wretch        negative \n","6759 wretched      negative \n","6760 wretchedly    negative \n","6761 wretchedness  negative \n","6762 wrinkle       negative \n","6763 wrinkled      negative \n","6764 wrinkles      negative \n","6765 wrip          negative \n","6766 wripped       negative \n","6767 wripping      negative \n","6768 writhe        negative \n","6769 wrong         negative \n","6770 wrongful      negative \n","6771 wrongly       negative \n","6772 wrought       negative \n","6773 yawn          negative \n","6774 yay           positive \n","6775 youthful      positive \n","6776 zap           negative \n","6777 zapped        negative \n","6778 zaps          negative \n","6779 zeal          positive \n","6780 zealot        negative \n","6781 zealous       negative \n","6782 zealously     negative \n","6783 zenith        positive \n","6784 zest          positive \n","6785 zippy         positive \n","6786 zombie        negative "]},"metadata":{},"output_type":"display_data"}],"source":["sentiments"]},{"cell_type":"markdown","id":"bbf784a1","metadata":{"papermill":{"duration":0.008119,"end_time":"2024-05-20T11:30:04.554014","exception":false,"start_time":"2024-05-20T11:30:04.545895","status":"completed"},"tags":[]},"source":["# Unigrams\n","- We will make use of three general-purpose lexicons:\n","\n","    - AFINN\n","    - bing\n","    - loughran\n","\n","- These three lexicons make use of the unigrams. Unigrams are a type of n-gram model that consists of a sequence of 1 item, that is, a word collected from a given textual data.\n","\n","- In the AFINN lexicon model scores the words in a range from -5 to 5. The increase in negativity corresponds the negative sentiment whereas an increase in positivity corresponds the positive one. \n","- The bing lexicon model on the other hand, classifies the sentiment into a binary category of negative or positive. \n","- The loughran model that performs analysis of the shareholder’s reports. In this project, we will make use of the bing lexicons to extract the sentiments out of our data. \n","\n","#### Reference: [ScienceDirect](https://www.sciencedirect.com/science/article/abs/pii/S095741741830143X)"]},{"cell_type":"markdown","id":"a3cec400","metadata":{"papermill":{"duration":0.008324,"end_time":"2024-05-20T11:30:04.569665","exception":false,"start_time":"2024-05-20T11:30:04.561341","status":"completed"},"tags":[]},"source":["# Sentiments"]},{"cell_type":"markdown","id":"0d8b3607","metadata":{"papermill":{"duration":0.008682,"end_time":"2024-05-20T11:30:04.585692","exception":false,"start_time":"2024-05-20T11:30:04.57701","status":"completed"},"tags":[]},"source":["## We can retrieve these lexicons using the get_sentiments() function. We can implement this as follows:"]},{"cell_type":"code","execution_count":4,"id":"e20a05c2","metadata":{"execution":{"iopub.execute_input":"2024-05-20T11:30:04.604389Z","iopub.status.busy":"2024-05-20T11:30:04.602411Z","iopub.status.idle":"2024-05-20T11:30:04.682641Z","shell.execute_reply":"2024-05-20T11:30:04.679846Z"},"papermill":{"duration":0.092975,"end_time":"2024-05-20T11:30:04.685974","exception":false,"start_time":"2024-05-20T11:30:04.592999","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A tibble: 6786 × 2</caption>\n","<thead>\n","\t<tr><th scope=col>word</th><th scope=